-- drop table

DROP TABLE IF EXISTS cars;

-- create table
create table cars (
	id BIGSERIAL NOT NULL PRIMARY KEY,
	make VARCHAR(50),
	model VARCHAR(50),
	price VARCHAR(50),
	actual_price FLOAT GENERATED ALWAYS AS (CAST(SUBSTRING(price, 2, LENGTH(price)) AS FLOAT)) STORED,
	year VARCHAR(50),
	vin VARCHAR(50)
);
